INSERT INTO `contractor_info` VALUES (14,'123456789','Environmental Management/Remediation','logo_14.gif',NULL,'Ecology  Control  Industries, Inc. (ECI) is a turnkey environmental services company   with proven environmental projects experience and a solid reputation  for  customer  service.  ECI was founded in 1977, providing transportation and  industrial services  \r\nto  commercial  clients  in  Southern California.  Through  recent  acquisitions  and  internal  growth,  ECI  has expanded services  throughout  the  western  United  States.  This expansion  has  provided   ECI  the  opportunity  to  strengthen  its   position   in  the environmental industry because of a large array of service capabilities.  \r\nECI  understands the issues that face our customers and our goal is to provide  the  most efficient and cost-effective environmental services available by demonstrating   business  oriented  recommendations  and  environmentally  responsible  solutions. \r\nECI\'s  client  list includes  Fortune 500 customers  from  the aerospace,  chemical, petroleum, manufacturing, and pharmaceutical industries as   well  as  major  prime  contractors  to United States Government Agencies.  \r\n\r\n','Yes','2003-12-17',500,'Sal Fernandez','310-354-9999','sfernandez@ecologycontrol.com','Jeanne Delperdang','310-354-9999','jdelperdang@ecologycontrol.com','','',NULL,'',NULL,NULL,0,NULL,NULL,0,0,1,3,NULL,0,NULL,0,NULL,3,'2014-02-14 11:26:20','Check','Missing',7,7,1,'2012-09-13',NULL,NULL,NULL,NULL,0,0,NULL,0.00,0,'2014-02-15 11:37:59',0,NULL,NULL,0.900,1.004,0.787,'Cleaning (Industrial);Demolition contractor;Environmental engineering;Environmental remediation services;Excavation contractors;Field Maintenance;Hazardous waste collection services;Hydroblasting;Rental and Leasing Services;Specialized Freight (except Used Goods) Trucking, Long-Distance;Tank cleaning and disposal services, commercial or industrial;Waste collection services, nonhazardous liquid;Waste management program administration','','2010-09-09 10:54:17',NULL,860,'2011-08-05 11:15:42',0,NULL,'Full',NULL,1,0,NULL,NULL,'',NULL,1001,0,1,NULL),(100,NULL,NULL,NULL,NULL,NULL,'Yes',NULL,500,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,0,0,2,NULL,2,NULL,2,NULL,2,NULL,'CreditCard',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0.00,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,'Full',NULL,1,0,NULL,NULL,NULL,NULL,1001,0,1,NULL);
