  `fromAddress` varchar(150) DEFAULT NULL,
  `toAddresses` varchar(1000) DEFAULT NULL,
  `ccAddresses` varchar(2000) DEFAULT NULL,
  `bccAddresses` varchar(2000) DEFAULT NULL,
  `subject` varchar(150) DEFAULT NULL,
  `body` mediumtext,
  `priority` tinyint(4) NOT NULL DEFAULT '50',
  `creationDate` datetime NOT NULL,
  `createdBy` int(11) DEFAULT NULL,
  `sentDate` datetime DEFAULT NULL,
  `templateID` int(11) DEFAULT NULL,
  `conID` int(11) DEFAULT NULL,
  `fromPassword` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `html` tinyint(4) NOT NULL DEFAULT '0',
  `viewableBy` int(10) DEFAULT NULL,
  `subjectViewableBy` int(10) unsigned DEFAULT NULL,
  `bodyViewableBy` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`emailID`),
  KEY `conTemplateSent` (`conID`,`templateID`,`sentDate`),
  KEY `status` (`status`),
  KEY `creationDate` (`creationDate`),
  KEY `toAddresses` (`toAddresses`(255)),
  KEY `templateID` (`templateID`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8;
